@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikiwand.com") {


/* ============= UNIFORM BACKGROUND COLORS ============= */

:root
{
  --main-bg : rgba(30,31,43,1);
  --side-bg : rgba(27,28,37,1);
}

/* ============================================================================== */
/* =============================== PAGE PRINCIPALE ============================== */


/* ----------- POPUP hyperliens ----------- */
body.light .title, body.light .tooltipster-ocd
{		
	color: #648772!important;	
	border-color:#3A5365!important;
}

/* ----------- Textes POPUP hyperliens ----------- */
body.light .tooltipster-ocd .tooltipster-content .text
{
	color: #777375!important;
}



/* ============================================================================ */
/* =============================== MENU WIKIWAND ============================== */


/*  ----------- Popup  ----------- */
.article_btn .drop_down, .article_btn .drop_down #feadback_list > li > a,
ul#feadback_list li, li.wikipedia_list
{
	/*background-color:#1F212E!important;*/
	border-bottom: 0px !important;
	border-top:0px !important;
	border:2px;
	border-radius:8px!important;
}	

/*  ----------- Lignes de Séparation  ----------- */
.article_btn .drop_down li,.feedback_btn .drop_down li
{
	border-top:1px solid #27293A!important;
}

/* Couleur fond survol 
.article_btn .drop_down #feadback_list>li>a:hover {	
background-color:#27293A!important;
}*/

/*  ----------- Menu Marques-pages  ----------- */
div#bookmark_wrapper h4
{
	color:#4A778A!important;
}
li.bookmark_instructions
{
	color:#6A9178!important;
}

/*  ----------- Pages Marquées  ----------- */
.book_title
{
	font-size: 17px;
	color: #6A9178!important;
}
p.book_txt
{
	color: #737373!important;
}

/*  ----------- Couleur Texte bouton FB  ----------- */
.inline_block_mid
{
	color:#252525!important;
}	

/*  ----------- Menu Langues  ----------- */
ul.drop_down li
{
	border-top:0px solid #27293A!important;
	color:transparent!important;
}

/*  ----------- Dégradé bas Bookmark  ----------- */
div#end_grad
{
	display:none!important;
}

/*  ----------- suppression texte/bouton install extension  ----------- */
.upgrade_txt, .upgrade_btn
{
	display: none!important;
}



/* ============================================================================ */
/* =============================== ESPACE DROIT =============================== */


/*  ----------- Lignes Séparations, tableau droit  ----------- */
#info_wrapper table caption, #info_wrapper table > tbody > tr,
#info_wrapper table > tbody > tr > td, #info_wrapper table > tbody > tr > th,
table.ww_ib_1 caption, table.ww_ib_1 > tbody > tr, table.ww_ib_1 > tbody > tr > td,
table.ww_ib_1 > tbody > tr > th table.ww_ib_1 > tbody > tr > td > hr
{
	background:none!important;
	border-bottom: 0px !important;
}
table.ww_ib_1 > tbody > tr > td > hr
{
	height:0px!important;
	color:transparent!important;
	background-color: transparent!important;
}

/*  ----------- Couleur nom perso fiction  ----------- */
td.entete.persofiction
{		
	color:#949EBC!important;		
}



/* ============================================================================== */
/* ================================== MAIN ====================================== */


/*  ----------- Image Fond - Principale  ----------- */ 

#content,
#articleSearch .searchResult,
#queryinput,
body.light #article_content_wrapper.padded, body.light #body_wrapp, body.light .tooltipster-ocd,
li.bookmark_card article ltr, section.ng-scope, .NavContent
{
	background:url('data:image/png;base64,')!important;
	background-attachment:fixed;
}


/* =========================================== */
/* ======== UNIFORM MAIN BACKGROUND ========== 

#content, #articleSearch .searchResult, #queryinput,
body.light #article_content_wrapper.padded, body.light #body_wrapp, body.light .tooltipster-ocd,
li.bookmark_card article ltr, section.ng-scope, div:nth-child(odd)
{
    background: var(--main-bg)!important;
}
*/




/*
table.wikitable:nth-child(4) > tbody:nth-child(2) > tr:nth-child(5) > td:nth-child(5n+0) {
background:#008040!important;
}
*/

/*  ----------- Couleur du Texte - Principale  ----------- */
.article_content
{
	list-style: inherit;
	color: #747474 !important;
}

/*  ----------- Couleur Liens hypertexte - Principale  ----------- */	
body.light a
{
	color: #6A9178 !important;
}

/*  ----------- Couleur Liens survolés - Principale  ----------- */	
body.light.mobile_webview a.active,
body.light:not(.mobile_webview) a:hover
{
	color: #00D56A!important;
}

/*  ----------- Couleur Titres article - Principale  ----------- */
span
{
	border: 0;
	margin: 0;
	padding: 0;
	color: #477083 !important;
}		

/*  ----------- Couleur Barre d'entête - Principale  ----------- */
#main_menu.navbar_opaque
{
	background-color: rgba(53,55,77,.1);
}

/*  ----------- Couleur Barre d'entête surimpression - Principale  ----------- */
body:not(.dark) #header.fold #main_menu.navbar_opaque
{
	background-color: rgba(81,84,117,.1);
}

/*  ----------- Couleur Barre d'entête sur photo - Principale  ----------- */
#main_menu
{
	position: relative;
	height: 100%;
	background-color: rgba(245,255,245,.0);
}

/*  ----------- Couleur Boutons - Principale  ----------- */	
#read_more a
{
	margin: 5px 12px 5px 0;
	font-family: "Open Sans",sans-serif;
	color: #FFFF00;
	font-size: 13px;
	background-color: #2E3043;
	border-radius: 10px;
}				

/*  ----------- Couleur textes boutons - Principale  ----------- */
span.title.ng-binding
{
	color: #6C719B !important;
}

/*  ----------- Couleur de la mention "Un article de Wikipédia, l'encyclopédie libre"  ----------- */	
body.light .title_wrapper h2
{
	color: #6C719B;
}

/*  ----------- Couleur des bordures tableaux - Principale  ----------- */
table.wikitable > * > tr > td, table.wikitable > * > tr > th,
table.wikitable > tr > td, table.wikitable > tr > th
{
	border: 1px solid #333A51;
	padding: .3em .4em;
}

/*  ----------- Couleur des titres tableaux - Principale  ----------- */	
table.wikitable:not(.infobox):not(.ww_ib_1) th
{
	font-weight: 700;
	font-size: 1.1em;
	background-color: rgba(0,0,0,.1);
	color:#4B768A!important;
}	

/*  ----------- Couleur des textes tableaux - Principale  ----------- */
table
{
	border-collapse: collapse;
	color: #928787!important;
}

/*  ----------- Légende photo - Principale  ----------- */
#info_wrapper div, #info_wrapper table div, .infobox div,
.infobox_v2 div, .infobox_v3 div, .sinottico div, .vertical-navbox div,
.ww_ib div, dl#infoboxCountry div
{
	margin: auto;
	color:#949EBC!important;
}
#info_wrapper div, #info_wrapper table div, .infobox div, .infobox_v2 div,
.infobox_v3 div, .sinottico div, .vertical-navbox div, .ww_ib div, dl#infoboxCountry div,
.NavContent, div.NavFrame, body.light .NavFrame .NavContent, table.tracklist.wikitable,
th, tr, td, .lang_btn .drop_down li.favourite_lang a, li.lang_pref a, li.wikipedia_list a,
div#bookmark_wrapper, .article_btn .drop_down, .article_btn .drop_down #feadback_list > li > a,
ul#feadback_list li, li.wikipedia_list, .per_btn .drop_down
{
	background: url('data:image/jpeg;base64,');
	border-radius: 6px !important;    
}

/*  ----------- Caractéristiques Pied de Page - Principale  ----------- */
.wikiwand_footer
{
	position: relative;
	width: 100%;
	margin-top: 80px;
	text-align: center;
	float: left;
	padding: 0 10px;
	direction: ltr;
	font-family: Lora,serif;
	background-color: #efefef;
	letter-spacing: 0;

	/* Affiche:inline / Cache:none */
	display:none!important;
}

/*  ----------- Couleurs titres barre droite  ----------- */
td.entete.map, th, tr
{
	color: #588CA5!important;
}

/*  ----------- Couleurs Alerte - Principale  ----------- */
body.light .wiki_alert
{
	background-color: transparent;
	color: #EA7500;
}

/*  ----------- Couleur des Pistes  ----------- */
body.light .NavFrame .NavContent
{
	font-size:100%!important;
	color: #588CA5 !important;
}

/*  ----------- Couleur des noms Albums  ----------- */
body.light .NavFrame .NavHead
{
	background:url('data:image/jpeg;base64,')!important;
	font:16px'verdana'!important;
	color: #949494 !important;
}
tbody
{
	border-radius: 6px!important;
}

/*  ----------- Couleur Block Tracklist - Principale  ----------- */
caption, p.bloc
{
	background: #1D1E2A !important;
}

/*  ----------- Couleur barres d'icônes Homonymes & Edition - Principale  ----------- */
body.light .title_icon
{
	border-color: #454765;
}

/*  ----------- Couleur des Fonds Formules Math - Principale  ----------- */
img.mwe-math-fallback-image-inline,
img.mwe-math-fallback-image-inline.immediate
{
	/*background:url('data:image/jpeg;base64,');*/
	background-color:#454869 !important;
	border-radius: 5px;
}

/*  ----------- Couleur Cadres Photos d'illustration - Principale  ----------- */
.ww-photo-group::after
{		
	background:transparent!important;				
}



/* =========================================================================== */
/* ============================== SIDEBAR ===================================== */


/*^ ----------- Couleur Texte - SideBar  ----------- */
#wikiwand_toc .toc_list > li > a
{
	color: #808080 !important;
	padding: 1.5px 10px 1.5px 0;
}
/*  ----------- nom  ----------- */
td.entete.defaut
{
	color:#64802A!important;
}

/*  ----------- Couleur Fond - SideBar  ----------- */
#wikiwand_toc
{
	background:url('data:image/png;base64,');
	background-attachment:fixed;
	position: relative;
	width: 90%;
	height: 100%;
	overflow: auto;
	font:15px'verdana';
}



/* ================================================ */
/* =========== UNIFORM SIDEBAR BACKGROUND ========= 

#wikiwand_toc
{
    background: var(--side-bg)!important;
}
*/



/*  ----------- Couleur Chapitre Survolé - SideBar  ----------- */
#wikiwand_toc .toc_list > ul
{
	background-color: #ff0800!important;
}

/*  ----------- Couleur Chapitre sélectionné - SideBar  ----------- */
#wikiwand_toc .toc_list > li.active
{
	background-color: #252736!important;
}

/*  ----------- Couleur de la barre d'entête - SideBar  ----------- */
#toc_btn
{
	font-size: 23px;
	background-color: #252736 !important;
}

/*  ----------- Largeur	SideBar  ----------- */	
body:not(.touch) #wikiwand_toc
{
	position: fixed;
	backface-visibility: hidden;
	width: 18%;
}

/*  ----------- Affiche:inline / Cache:none  les Copyright - BasDePage  ----------- */
.page_copyright
{
	display:none!important;
}



/* ============================================================================= */
/* ============================= RECHERCHES =================================== */ 


/*  ----------- Couleur du texte de recherche  ----------- */
#queryinput
{
	color:#6A9178!important;
	border-radius:10px;
}

/*  ----------- Couleur textes résultats et lignes séparation  ----------- */
#articleSearch .searchResult
{
	font-family: "Open Sans",sans-serif;
	color: #4A768A;
	border-bottom: 1px #31364D solid;
}

/*  ----------- Couleur barres de langues  ----------- */
#articleSearch .langtag
{
	background-color: #808080;
}

/*  ----------- Couleur de surimpression des termes recherchés  ----------- */
.single-search-result .searchmatch
{
	background-color: rgba(60,63,79,.5);
	border-radius: 7px!important;
	padding: 1px 5px 2px;
}


/* ============================================================================== */
/* ================================== FIN ======================================== */
/* ============================================================================== */

}
